import React from 'react';
import { IRowProps } from '../types/types';
import Column from './Column';

const Row = (props: IRowProps) => {

    return (
        <>
            <div className="row">
                <Column style={{
                    backgroundColor: '#bbbbbb',
                    height: '50vh',
                }}
                />
                <Column style={{
                    backgroundColor: '#cccccc',
                    height: '50vh',
                }}
                />
                <Column style={{
                    backgroundColor: '#dddddd',
                    height: '50vh',
                }}
                />
            </div>
        </>
    )
}

export default Row;
